  false,\n\t\"url\": null,\n\t\"notes\": \"Proposal for the U.S. Fish and Wildlife
  Service and the Colorado Division of Wildlife to purchase the White Ranch property
  in Saguache County as partial fulfillment of the Reclamation's mitigation requirements
  as outlined in the fish and Wildlife Coordination Act Report, 1982 for the Closed
  Basin Division of the San Luis Valley Project (FWCA Report). It is proposed that
  this property, along with associated water rights, be incorporated in to the National
  Wildlife Refuge System as part of the Alamosa/Monte Vista National Wildlife Refuge
  Complex. The property includes approximately 3,302 acres in two major ownerships
  and is composed of (irrigated) wet meadow interspersed with mudflat and greasewood
  uplands.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
